export default function Footer() {
    return (
        <div className="footer">
            <div className>
        <img src="./images/Twitter.png"/>
        <img src="./images/Facebook.png"/>
        <img src="./images/Instagram.png"/>
        <img src="./images/GitHub.png"/>
        </div>
        </div>
    )
}
